import { Box, FAB, ListItem, Stack } from '@react-native-material/core';
import Icon from '@expo/vector-icons/MaterialCommunityIcons';
import { SafeAreaView } from 'react-native-safe-area-context';
import { FlatList, ScrollView, StyleSheet, Text, View } from 'react-native';
import Constants from 'expo-constants';

const Home = ({ navigation: { navigate } }: any) => {
  function handleNavigationForm() {
    navigate('Form', { names: ['Brent', 'Satya', 'Michaś'] });
  }

  return (
    <SafeAreaView style={{ flex: 1 }}>
      <Box
        w={'100%'}
        h={'100%'}
        style={{
          flex: 1,
        }}
      >
        {/* Main */}
        <Box
          style={{
            flex: 1,
          }}
        >
          <ScrollView
            contentContainerStyle={{
              paddingHorizontal: 16,
              paddingBottom: 50,
            }}
            style={{
              flex: 1,
              paddingTop: Constants.statusBarHeight + 20,
              backgroundColor: '#F0F0F5',
            }}
          >
            <ListItem
              title="Inbox"
              leading={<Icon name="inbox" size={24} />}
              trailing={(props) => <Icon name="chevron-right" {...props} />}
              secondaryText="I'll be in your neighborhood doing errands this…"
            />
          </ScrollView>
        </Box>

        {/* Footer */}
        <Box
          style={{
            alignItems: 'flex-end',
            padding: 8,
            backgroundColor: 'transparent',
            position: 'absolute',
          }}
        >
          <Stack fill center spacing={4}>
            <FAB
              onPress={handleNavigationForm}
              icon={(props) => <Icon name="plus" {...props} />}
            />
          </Stack>
        </Box>
      </Box>
    </SafeAreaView>
  );
};

export default Home;
